import React from "react";
import "./Header";

function Header() {
  return (
    <form className="form-header">
      <input
        type="email"
        class="form-control"
        id="exampleFormControlInput1"
        placeholder="name@example.com"
      ></input>
    </form>
  );
}
export default Header;
